import react from "react";
import {Link} from "react-router-dom";

const ListTripsPage = () => {
    return 
    <div>
        <h1>Lista de Viagens</h1>
        <Link to="/">Voltar</Link>
        <Link to="/form">Increva-se</Link>
    </div>



}

export default ListTripsPage;
